import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import MailIcon from '@mui/icons-material/Mail';
import Homeicon from '@mui/icons-material/Home';
import { Link } from 'react-router-dom';

const drawerWidth = 160;

export default function PermanentDrawerLeft() {
    return (
        <Box sx={{ display: 'flex' }}>
            <Drawer
                sx={{
                    width: drawerWidth,
                    flexShrink: 0,
                    '& .MuiDrawer-paper': {
                        width: drawerWidth,
                        boxSizing: 'border-box',
                    },
                }}
                variant="permanent"
                anchor="left"
            >
                <Toolbar />
                <Divider />
                <List>
                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Dashboard
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Dashboard
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Dashboard
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                </List>
                <Divider />
                <Typography variant="subtitle1" sx={{ color: 'primary.800' }}>
                    Get Extra Space
                </Typography>
                <List>
                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Profile
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Sign In
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Sign Out
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                    <ListItem disablePadding component={Link} to={"/"}>
                        <ListItemButton>
                            <ListItemIcon>
                                <Homeicon></Homeicon>
                            </ListItemIcon>
                            <ListItemText sx={{ ml: "-20px" }}>
                                Log Out
                            </ListItemText>
                        </ListItemButton>
                    </ListItem>

                </List>
            </Drawer>

        </Box>
    );
}
